import React from "react";

const Login = () => {
  return (
    <button className={btnClasses}>
      {/* icon */}
      <span className={classes.icon}>
        <CartIcon />
      </span>
      {/* text */}
      <span>Your Cart</span>
      {/* badge */}
      <span className={classes.badge}>{numberOfCartItems}</span>
    </button>
  );
};

export default Login;
